import { Component, useState } from "react";
import { useDispatch, useSelector } from "react-redux"
import TodoSubList from './todosublist'

const ShowListItem = () => {
    const selec = useSelector(state => state)
    if (Object.keys(selec).length >= 1) {
        console.log("using selector", selec)
        console.log("using selector len", Object.keys(selec))

        let mapper =
            selec.payload.map(input =>
                <div className="holder">
                    <div className="container">
                        <div className="item2">{input.task}<button type='button' >Clickhere</button></div>
                        <div className="item2">{input.dateE}</div>
                        <div className="item2">{input.dateB}</div>
                        <div className="item2">{input.completed}</div>

                    </div>
                    <div>{(input.steps.length > 0 && input.show) && TodoSubList(input.steps)}
                    </div>
                </div>
            )
        return mapper
    }
    return null
}

export default ShowListItem
